import React, { useContext } from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import { AuthContext } from './context/AuthContext';

import Navbar from './components/Navbar';
import ScrollToTop from './ScrollToTop';

// üè† Pages
import Home from './pages/Home';
import MovieDetails from './pages/MovieDetails';
import TheatersPage from './pages/TheatersPage';
import Login from './pages/Login';
import Signup from './pages/Signup';
import BookMovie from './pages/BookMovie';
import BookingHistory from './pages/BookingHistory';
import MyBookings from './pages/MyBookings';
import BookingSummary from './pages/BookingSummary';
import AdminDashboard from './pages/admin/AdminDashboard';

// üîê Protected Route wrapper
const ProtectedRoute = ({ isAuthenticated, children }) => {
  return isAuthenticated ? children : <Navigate to="/login" replace />;
};

// üõ°Ô∏è Admin Route wrapper
const AdminRoute = ({ isAuthenticated, isAdmin, children }) => {
  return isAuthenticated && isAdmin ? children : <Navigate to="/" replace />;
};

function App() {
  const { isAuthenticated, user } = useContext(AuthContext);
  const isAdmin = user?.role === 'admin';

  return (
    <>
      <ScrollToTop />
      <Navbar />

      <main className="min-h-screen bg-gradient-to-br from-black via-gray-900 to-gray-800 text-white">
        <Routes>
          {/* üåê Public Routes */}
          <Route path="/" element={<Home user={user} />} />
          <Route path="/movie/:id" element={<MovieDetails />} />
          <Route path="/theaters" element={<TheatersPage />} />

          {/* üîê Auth Routes */}
          <Route
            path="/login"
            element={!isAuthenticated ? <Login /> : <Navigate to="/" replace />}
          />
          <Route
            path="/signup"
            element={!isAuthenticated ? <Signup /> : <Navigate to="/" replace />}
          />

          {/* üéüÔ∏è Protected Routes */}
          <Route
            path="/book/:id"
            element={
              <ProtectedRoute isAuthenticated={isAuthenticated}>
                <BookMovie />
              </ProtectedRoute>
            }
          />
          <Route
            path="/bookings"
            element={
              <ProtectedRoute isAuthenticated={isAuthenticated}>
                <BookingHistory />
              </ProtectedRoute>
            }
          />
          <Route
            path="/my-bookings"
            element={
              <ProtectedRoute isAuthenticated={isAuthenticated}>
                <MyBookings />
              </ProtectedRoute>
            }
          />
          <Route
            path="/my-bookings/:id"
            element={
              <ProtectedRoute isAuthenticated={isAuthenticated}>
                <BookingSummary />
              </ProtectedRoute>
            }
          />

          {/* üõ°Ô∏è Admin Routes */}
          <Route
            path="/admin"
            element={
              <AdminRoute isAuthenticated={isAuthenticated} isAdmin={isAdmin}>
                <AdminDashboard />
              </AdminRoute>
            }
          />

          {/* üö´ Fallback */}
          <Route path="*" element={<Navigate to="/" replace />} />
        </Routes>
      </main>
    </>
  );
}

export default App;
